description:
This application (DMI) helps you remove disturbing digital noise from your photos.

DenoiseMyImage is highly optimized. Besides an optimized algorithm we used SSE,SSE2 instructions, multithreading and HW acceleration (computing on graphics card - GPGPU) for better performance.

Application supports upto 16 cores on CPU, and following list of graphics cards for acceleration: 

ATI HD 4xxx, 5xxx, AMD HD 6xxx, 7xxx, 8xxx and later

NVIDIA GTX 2xx, 3xx, 4xx, 5xx, 6xx and later.

